package bitcamp.java142.ch6;

import java.io.IOException;
import java.net.InetAddress;
import java.net.Socket;

public class PortScannerTest2 extends Thread { //java.lang의 Thread불러와;; 인터페이스는 implement; 클래스는 extends
	protected static final int SIZE =136;
	protected InetAddress target;
	protected int id;
	
	public PortScannerTest2(InetAddress target, int id) throws Exception {
		super("Port Scanner #" + id);
		this.target = target;
		this.id = id;
	}//PortScannerTest생성자 끝

	public void run(){
		int port = 0;
		Socket s = null;
		for (int i =0; i<SIZE ; i++){
			try{
				port = SIZE * id + i;
				s =new Socket(target, port);
				System.out.println("Port #" + port + " is open");
				s.close();
			}catch(IOException ioe){
				System.out.println(">>> [" +i+ "] <<<" + ioe);
			}finally{
				try{
					s.close();
				}catch(Exception ignored){}//finally 안 try-catch끝
			}// try-catch-finally 끝			
		}//for끝
	}//run()함수 끝
	
	public static void main(String[] args)  {
		// TODO Auto-generated method stub
		String host = "localhost";
		try{
			InetAddress addr = InetAddress.getByName(host);
			for(int i =0; i<SIZE; i++){
				System.out.println("<<<<<<  ["+i+"] >>>>>>");
				Thread.sleep(5000);		
				System.out.println("<<<-----["+i+"]----->>>");
				new PortScannerTest2(addr,i).start();
			}//for끝
		}catch(Exception e){
			System.out.println(">>>----- [ 메인 error ] -----<<<" + e);
		}//try-catch 끝
	}//메인 끝

}//클래스 끝

